import React from "react";

import NavigationItems from "../NavigationItems/NavigationItems";
import "./Sidebar.css";
const sidebar = (props) => {
  return (
    <div className="sidebar">
      <h1 class="logo">
        <span class="text-primary">
          <i class="fas fa-book-open"></i> Flake
        </span>
        Software
      </h1>
      <nav>
        <NavigationItems />
      </nav>
    </div>
  );
};

export default sidebar;
